  \"2016-07-27T23:02:03.469701\",\n\t\"name\": \"investigations-of-arctic-coastal-plain-avifauna-trans-alaska-pipeline-investigations-1975-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Bird populations were studied from 31 May
  to 1 - August 1975 on an 18 square-kilometer area bordering the Beaufort Sea (see
  Bergman 1974) at Storkersen Point. Data were collected on density of nesting species
  in weekly or biweekly ground surveys. Nests found were marked and subsequently relocated
  in order to determine clutch size, success, and nest characteristics. Non-nesting
  species were recorded as they were observed during the study. An experimental oil
  spill study initiated in 1974 was continued and expanded in 1975.\",\n\t\"license_title\":
